import React from "react";

function HelloDiv() {
  return (
    <div>
      <h1>Hi, my name is DimiGod! I like</h1>
      <ul>
        <li>girls</li>
        <li>cars</li>
      </ul>
    </div>
  );
}

export default HelloDiv;
